import React from 'react';
import { Link } from 'react-router-dom';
import Header from '../../components/common/Header';
import Layout from '../../components/common/Layout';

const SecondPage: React.FC = () => {
    return (
        <Layout>
            <Header />
            <div className="flex h-screen">
                <div className="w-1/2">
                    <img src="/path/to/your/image.jpg" alt="Description" className="w-full h-full object-cover" />
                </div>
                <div className="w-1/2 bg-white flex flex-col justify-center items-center">
                    <h1 className="text-black text-2xl mb-4">Welcome to the Second Page</h1>
                    <div className="flex flex-col space-y-4">
                        <Link to="/login">
                            <button className="bg-[#C4F439] text-white rounded-full px-6 py-2">
                                Iniciar sesi√≥n
                            </button>
                        </Link>
                        <Link to="/another-page">
                            <button className="bg-black text-white rounded-full px-6 py-2">
                                Another Action
                            </button>
                        </Link>
                    </div>
                </div>
            </div>
        </Layout>
    );
};

export default SecondPage;
